import { useState } from 'react'
import Header from './components/Header'
import Weekdays from './components/Weekdays'
import './App.css';

const App = () => {
const [weekday, setWeather] = useState(
  [
    {
      id: 1,
      weatherType: 'Rainy',
      day: 'Sunday',
      picture: null,
    },
    {
      id: 2,
      weatherType: 'Sunny',
      day: 'Monday',
      picture: null,
    },
    {
      id: 3,
      weatherType: 'Cloudy',
      day: 'Tuesday',
      picture: null,
    }
  ]
)
  return (
    <div className="container">
      <Header />
      <Weekdays weekday={weekday} />
    </div>
  )
}

export default App;
